import React from "react";
import Header from "../components/Header/Header";

const HomeWrapper = styled.div``;

const About = () => {
  return (
    <HomeWrapper>
      <Header />
      <h2>우리회사는말이야!</h2>
    </HomeWrapper>
  );
};

export default About;
